import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import PaperComponent1 from "../components/Paper1";
import Pic from "../img/carousel_1.jpg";

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
    '& > *': {
      width: '80%',
      margin: '3% auto 5% auto',
      color: '#383e56',
      height: '45em',
      padding: '3em',
    },
  },
}));

export default function Paper1() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Paper
        elevation={3}
        children={
          <div>
            <div>
              <h1 className="paper-header">Mutter-Kind-Pass</h1>
              <hr className="hr-duck" />
              <div className="row">
                <div className="col-8">
                  <h1>Jakob</h1>
                </div>
                <div className="col-4">
                  {Pic}
                </div>
              </div>
            </div>
          </div>
        }
      />
    </div>
  );
}
